import React from 'react';
import firebase from 'firebase';


class LogOut extends Component {
    render() {
        return(
            <a onClick={logOutUser}>Log Out</a>
        );
    }
}

const logOutUser = () => {
    firebase.auth().signOut();
};

export default LogOut;
